import "./AboutStyles.css";
import React from "react";

function AboutUs() {
    return (
        <div className="about-container">
            <h1>Our History</h1>
            <p>
                The origins of Trippy drawings trace back to the 1940s when Swiss chemist Albert Hofmann discovered lysergic acid diethylamide (LSD). Hofmann was researching derivatives of lysergic acid to create a circulatory and respiratory stimulant with no negative side effects on the uterus. The result? LSD. After creating the drug, he began experimenting with it and soon discovered its powerful psychedelic effects.
            </p>

            <h1>Our Mission</h1>
            <p>
                Our mission is to reach new horizons where our capabilities seamlessly align with the unique needs of our clients, all while maintaining ultimate transparency and cost-effectiveness.
            </p>

            <h1>Our Vision</h1>
            <p>
                Our vision is to cultivate exceptional services with a customer-centric approach, building trust with clients worldwide.
            </p>

        </div>
    );
}

export default AboutUs;
